import React , { useState } from 'react';
//import './pages.css';
import about from "../../public/images copy";

export default function getAbout()
{

    return (
        <div style={{ display: "flex", flexDirection: "row", alignSelf: "flex-start" }}>
            {
                about.map(about => {
                    return (
                        <div>


                        <div className='product_card' style={{
                            width: "150px", 
                            margin: "15px"
                        }}>

                            <img className='about_image' src={about.icon} width="100" height="100" alt='prod_image'/>

                            <p>{about.name}</p>
                            <p>{about.role}</p>
                            <p>{about.discription}</p>
                        </div>


                        </div>
                    )
                })

            }

        </div>
    );
}
